import { Header } from "./components/Header";
import './style/app.css'
import { Menu } from "./components/Menu"; 
import { BrowserRouter, Route, Routes } from "react-router-dom";
import io from 'socket.io-client'

function App() {
  return (
    <BrowserRouter>
      <Header/>
      <Routes>
        <Route path="/" element={<Menu/>}/>
      </Routes>
    </BrowserRouter>
  );
}


export default App;
